import React, { Component } from 'react'
import ReactNavbar from "react-responsive-animate-navbar";

class Navbar extends Component {
    render() {
        return (
            <ReactNavbar>
        color="rgb(25, 25, 25)"
        menu={[
          { name: "Home", to: "/" },
          { name: "Cats", to: "/cat-list" },
          { name: "Rescue Stories", to: "/RescueStories" },
          { name: "Login", to: "/login" },
        ]}
            </ReactNavbar>
        )
    }
}

export default Navbar;
